  XW += x[45] * 55.100000;                 // iC4H7-1
  XW += x[46] * 30.006000;                 // NO
  XW += x[47] * 46.005000;                 // NO2
  XW += x[48] * 27.026000;                 // HCN
  XW += x[49] * 17.031000;                 // NH3
